VALUES ('3560071012915', 'Émincés de bœuf au vinaigre balsamique sauce au soja et purée à la patate douce', 'Purée à la patate douce et aux pommes de terre 53,6 % (150 g) : patate douce 32 %, purée de pomme de terre 11 %, _crème fraiche_, _beurre_, sel, arôme naturel de paprika, épaississant : gomme xanthane, poivre. Émincés de viande de bœuf saumurée, jus au vinaigre balsamique de Modème et à la sauce au soja 46,4 % (130 g) :  de viande de bœuf saumurée 32 % (viande de bœuf 26 %, eau,  fécule de manioc, sel), eau, préparation aromatique (arôme naturel, colorants : caramel ordinaire – curcumine – extrait de paprika), vinaigre balsamique de Modème 2,5 % (vinaigre de vin, moût de raisin, colorant : caramel au sulﬁte d\'ammonium, conservateur : disulfite de potassium), sauce au _soja_ 1,7 % (eau, graine de _soja_, sel, farine de _blé_), sucre, gingembre, épaississant : gomme xanthane. Viande de bœuf origine France.  Pourcentages exprimés sur le produit ﬁni.', 'https://static.openfoodfacts.org/images/products/356/007/101/2915/front_fr.6.400.jpg', '6.2', '4.4', '8.5', '3.5', '1.4', '9.3', '1.1', '0.433070866141732', '', '0');

