VALUES ('3560071012922', 'Plat cuisiné cabillaud polenta butternut Selection', 'Polenta à la courge butternut 42,9% (120 g) : courg butternut 25%, crème fraîche 8,1 polenta (semoule de maïs précuite 6,4%, beurre 1,7%, arôme naturel, persil, sel, ail en poudre, muscadi poivre. Dos de cabillaud 35,7% (100 g) : Dos de cabillaud 35,7%. Sauc à la crème, au beurre, au lait de coco et au curry Madras 21 ,4% (60 g) Crème fraîche 9,2%, eau, vin blanc (contient sulfites), beurre 1%, jus dl citron, jaune d\'œuf en poudre, lait de coco en poudre (contient lait) mélange d\'épices curry Madras 0,3% (gingembre, coriandre, curcumt ail, céleri, piment fort), farine de blé, sel, épaississant : gomme xanthanc poivre. Pourcentages exprimés sur le produit fini. Préparation - Au bain-marie (Recommandé) : Déposez la coupelle et les sachet dans une casserole dleau frémissante. Faites réchauffer enviro 10 minutes la coupelle de polenta et 6 à 7 minutes le sachet de poisso le sachet de sauce. Enlevez Ilexsudat du poisson et remue ement le sachet de sauce avant de servir. Démoulez la coupell \'cro-ondes : Ouvrez la coupelle et les sachets sur 1 cm fi0ntenant sur une assiette. Faites-réc', 'https://static.openfoodfacts.org/images/products/356/007/101/2922/front_fr.14.400.jpg', '7.2', '5.3', '7.4', '1', '0.8', '8.4', '0.64', '0.251968503937008', '', '1');

