VALUES ('3560071012939', 'Pavé de filet de canard sauce au cassis et écrasé de pomme de terre', 'Ecrasé de pomme de terre 42,9 % (120 g) : pomme de terre 32 %, _beurre_ 4,2 %, eau, _lait_ demi-écrémé, sel, amidon modiﬁé de pomme de terre, curcuma. Pavé de filet de canard saumuré 39,3 % (110 g) : pavé de ﬁlet de canard 33 %, eau, fécule de manioc, sel, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Sauce à la purée de cassis 17,8 % (50 g) : eau, Porto rouge modiﬁé (Porto rouge, arôme naturel de poivre, sel, conservateur : _anhydride sulfureux_). purée de cassis 2,9 %, préparation aromatique (arôme naturel, colorants : caramel ordinaire – curcumine – extrait de paprika), sucre, _beurre_ 0,7 %, oignon en poudre, sel, colorant : anthocyanes (contient _sulﬁtes_), épaississant : gomme xanthane, poivre. Viande de canard origine France.  Pourcentages exprimés sur le produit ﬁni.', 'https://static.openfoodfacts.org/images/products/356/007/101/2939/front_fr.5.400.jpg', '9', '4.1', '7.7', '2.4', '1', '9.7', '0.85', '0.334645669291339', '', '1');

