a, magere melkpoeder, emulgatoren: splalecithinen en polyglycerol-polyricinoleaat. Saus met karamel met gezouten boter 21,1%: Gerehydrateerde magere melk, suiker, water, glucosestroop, karamel met gezouten boter 0,6% [glucose-fructosestroop, gecondenseerde volle melk met suiker (melk 0,06%, suiker), gezouten hQ_tgc 0,1%, water, suiker, zoutl, geleermiddelen: johannesbroodpitmeel en guarpitmeel, emulgator: mono- en diglyceriden van vetzuren, kleurstof: karamel, natuurlijk aroma, zout. Stukjes karariel 3,7%: Suiker, cacaoboter, water. Percentages uitgedrukt op het volledige product, Kan sporen bevatten van gluten, eieren, aardnoten en noten-', 'https://static.openfoodfacts.org/images/products/356/007/101/8740/front_fr.4.400.jpg', '16', '9.6', '35', '32', '0.5', '2.1', '0.32', '0.125984251968504', '', '0');

