es noires confites 1,1% (olives, eau, sel, stabilisant : gluconate ferreux), écorces de citron confit 0,5% (écorces de citron, sucre, jus de citron concentré), moutarde à l\'ancienne [vinaigre d\'alcool, graines de moutarde, eau, sel, sons de moutarde, acidifiant : acide citrique, épices (contient céleri)], huile d\'olive vierge extra, ail déshydraté, jus de citron concentré, poivre. Peut contenir des traces de : soja, fruits à coque, crustacés, graines de sésame.', 'https://static.openfoodfacts.org/images/products/356/007/106/7533/front_fr.9.400.jpg', '7.1', '2.5', '31', '9', '3.8', '9.1', '1.3', '0.511811023622047', '', '0');

